import React from "react";

//Local stuff.
import "../styles/main.scss";
import Navigation from "../components/Navigation";

class Home extends React.Component {
  render() {
    return (
      <div className="portfolio">
        <div className="center-page">
          <Navigation />

          <div className="space-a"></div>
        </div>
      </div>
    );
  }
}

export default Home;
